import { Link } from "react-router-dom";

const Product = () => {
  return;
  <section>
    <h1>The Product Page!</h1>
    <ul>
      <li>
        <Link>A book</Link>
      </li>
      <li>A carpet</li>
      <li>A pencil</li>
    </ul>
  </section>;
};

export default Product;
